(window.webpackJsonp=window.webpackJsonp||[]).push([[877],{1232:function(n,h,c){"use strict";c.r(h);var t=c(44),g=Object(t.a)({},(function(){var n=this,h=n.$createElement,c=n._self._c||h;return c("ContentSlotsDistributor",{attrs:{"slot-key":n.$parent.slotKey}},[c("h1",{attrs:{id:"chuong-1764-đau-gia-danh-ngach-【-canh-thu-hai-】"}},[c("a",{staticClass:"header-anchor",attrs:{href:"#chuong-1764-đau-gia-danh-ngach-【-canh-thu-hai-】"}},[n._v("#")]),n._v(" Chương 1764: Đấu giá danh ngạch 【 canh thứ hai 】")]),n._v(" "),c("hr"),n._v(" "),c("p",[n._v("Chương 1764: Đấu giá danh ngạch "),c("br"),c("br"),n._v("“Cũng phải...”"),c("br"),c("br"),n._v("Danh Sư đường cái khác Cổ Thánh lặng im."),c("br"),c("br"),n._v("Trương Hoằng Thiên nói trần trụi, nhưng quả thực là sự thật."),c("br"),c("br"),n._v("Cái gì quy củ, cái gì ước định, trò đùa trẻ con còn tốt, liên lụy đến Xuân Thu đại điển, ai còn có thể quản đến nhiều như vậy?"),c("br"),c("br"),n._v("Dị Linh tộc nhân, Thánh thú, chỉ có một cái danh ngạch, đều không có quá nhiều tranh luận, thật chẳng lẽ cho rằng, từ bỏ món bảo vật này?"),c("br"),c("br"),n._v("Chỉ cần có người đi vào, chẳng khác nào biết tình huống bên trong, đến lúc đó, Xuân Thu đại điển tại trong tay ai, rõ ràng, một khi rời đi cung điện, bên ngoài thủ hộ Cổ Thánh liền sẽ ra tay!"),c("br"),c("br"),n._v("Khi đó, đã không phải Bất Hủ cảnh có thể nhúng tay, kết quả sau cùng, vẫn là phải dựa vào Cổ Thánh thực lực, mới có thể nói chuyện!"),c("br"),c("br"),n._v("“Trước phân phối danh ngạch đi!”"),c("br"),c("br"),n._v("Những lời này, sợ gây nên hoảng loạn, rất nhiều Cổ Thánh là truyền âm."),c("br"),c("br"),n._v("“Những này danh ngạch, đều là vị này Trương Huyền sức một người đạt được, phân chia như thế nào, chúng ta đều tôn trọng quyết định chính là!”"),c("br"),c("br"),c("br"),n._v("“Ừm!”"),c("br"),c("br"),n._v("Đám người đồng thời gật đầu."),c("br"),c("br"),n._v("Thân là Cổ Thánh, đối với những này danh ngạch, không làm ra một điểm cống hiến, thật không tiện cưỡng cầu."),c("br"),c("br"),n._v("..."),c("br"),c("br"),n._v("“Lão sư, Trịnh Dương bọn họ tạm thời liên lạc không được, có điều, cho gặp qua bằng hữu của bọn hắn đưa tin, dường như cũng đều được một loại nào đó cơ duyên, tại một ít bên trong tiểu thế giới, không cách nào rời đi, khả năng không có cơ hội đi vào chủ điện!”"),c("br"),c("br"),n._v("Không đi quản Cổ Thánh như thế nào thảo luận, Trương Huyền bên này, Triệu Nhã đi tới trước mặt."),c("br"),c("br"),n._v("Vừa rồi đã đưa tin hỏi qua, thân là Băng Nguyên cung cung chủ, coi như không liên lạc được Trịnh Dương đám người, cũng sẽ có chút tin tức phương pháp."),c("br"),c("br"),n._v("Dù sao, nàng mấy cái này sư đệ, sư muội, sớm đã không phải bừa bãi vô danh nhân vật, mà đều là một phương đại lão."),c("br"),c("br"),n._v("“Tới không được?” Nhíu mày một cái, Trương Huyền ngay sau đó khoát tay áo: “Thôi được, thật có tốt cơ duyên lời nói, cũng không có khả năng thiếu đi bọn họ, đi vào hay là không vào vào, đều không quan trọng...”"),c("br"),c("br"),n._v("Liền giống như Bồ Đề quả, Viên Đào cũng chưa đi đến vào qua Tẩm điện, nhưng mà có loại này tấn thăng tâm cảnh cơ duyên, còn là cho hắn."),c("br"),c("br"),n._v("Vì lẽ đó, rất nhiều đệ tử, có thể hay không có cơ hội đi vào không sao cả, chỉ cần mình đạt được, khẳng định sẽ có phần của bọn hắn."),c("br"),c("br"),n._v("“Lão sư, ta cũng không vào, cơ thể ta đã đạt tới Cổ Thánh cấp bậc, vừa rồi lặng lẽ thăm dò một chút, cho dù có mẫu phù bao phủ, cũng sẽ nhận phong ấn bài xích...”"),c("br"),c("br"),n._v("Viên Đào đi tới trước mặt."),c("br"),c("br"),n._v("“Cái này...” Trương Huyền cau mày."),c("br"),c("br"),n._v("Người học sinh này, tuy là không có xung kích Cổ Thánh thành công, nhưng cũng là thực sự Cổ Thánh thân thể, nắm giữ nửa bước Cổ Thánh năng lực, không cách nào đi vào, không gì đáng trách."),c("br"),c("br"),n._v("“Ta, Lạc Nhược Hi, Triệu Nhã, Ngụy Như Yên, Lạc Thất Thất... Lại thêm Danh Sư đường hai vị, hiện nay là bảy cái...”"),c("br"),c("br"),n._v("Trương Huyền trong lòng tính toán: “Tính như vậy, còn có bốn cái danh ngạch...”"),c("br"),c("br"),n._v("Xoa xoa mi tâm, nhìn Danh Sư đường đám người liếc mắt, ngay sau đó lắc đầu."),c("br"),c("br"),n._v("Không phải xem thường hắn những thiên tài này, mà là đem danh ngạch cho bọn hắn, tác dụng không lớn, cho nhiều hơn nữa, cũng là lãng phí."),c("br"),c("br"),n._v("“Thế nào? Có hay không xác định nhân tuyển?”"),c("br"),c("br"),n._v("Thấy hắn trầm tư hồi lâu, người còn không có chọn lựa đến, nhíu mày, Nhan Thanh Cổ Thánh hỏi."),c("br"),c("br"),n._v("“Đã chọn được... Bất quá, nhiều như vậy danh ngạch, ta cảm thấy chúng ta muốn cũng là lãng phí, hiện tại lấy ra bốn cái danh ngạch tiến hành đấu giá! Các ngươi tam phương, cũng có thể mua sắm, người trả giá cao được, như thế nào?”"),c("br"),c("br"),n._v("Cười cười, Trương Huyền ngẩng đầu."),c("br"),c("br"),n._v("“Đem danh ngạch đấu giá?”"),c("br"),c("br"),n._v("“Cái tên này không điên a? Tất cả mọi người cướp đoạt, hắn ngại nhiều?”"),c("br"),c("br"),n._v("“Thật hay giả?”"),c("br"),c("br"),n._v("Bốn phía một hồi xôn xao."),c("br"),c("br"),n._v("Tất cả mọi người bối rối."),c("br"),c("br"),n._v("Không chỉ tam đại thế lực Cổ Thánh, ngay cả Danh Sư đường bên này, Trương Hoằng Thiên đám người, cũng từng cái trước mắt choáng váng."),c("br"),c("br"),n._v("Bọn họ thật vất vả có nhiều như vậy danh ngạch, cơ hội tốt như vậy, đấu giá..."),c("br"),n._v(" Làm như vậy, thật được không?"),c("br"),c("br"),n._v("“Hắn làm như vậy...”"),c("br"),c("br"),n._v("Một cái Cổ Thánh cũng nhịn không được nữa, muốn mở miệng khuyên can."),c("br"),c("br"),n._v("“Sư huynh làm như vậy, khẳng định có tính toán của mình...” Dương sư mở miệng: “Chúng ta tin tưởng hắn liền tốt!”"),c("br"),c("br"),n._v("“Sư huynh?”"),c("br"),c("br"),n._v("Mấy vị Cổ Thánh đồng loạt nhìn qua."),c("br"),c("br"),n._v("Vị này Dương Huyền, bọn họ trước đó lúc thanh tỉnh, chỉ thấy qua, là gần mấy trăm năm qua, nhất thiên phú nhân vật, hiện tại càng là tấn cấp đến Cổ Thánh, xưng hô cái này Kim Thân cảnh tiểu gia hỏa là sư huynh..."),c("br"),c("br"),n._v("“Đúng vậy a...”"),c("br"),c("br"),n._v("Gật gật đầu, Dương sư dùng ý niệm ngăn cách bốn phía, truyền âm qua: “Thực không dám giấu giếm, thân phận của hắn, có chút đặc thù! Có thể trở thành sư đệ của hắn, dù là ta là Cổ Thánh, đều là vinh hạnh cực kỳ! Bất quá, chuyện này, tạm thời vẫn chưa thể nói tỉ mỉ, Khổng miếu sự tình kết thúc, ta lại kỹ càng hướng các vị tiền bối báo cáo!”"),c("br"),c("br"),n._v("“Đặc thù?”"),c("br"),c("br"),n._v("Mấy vị Cổ Thánh từng cái tràn đầy kỳ lạ."),c("br"),c("br"),n._v("Đến cùng loại nào đặc thù, có thể để cho Cổ Thánh đều cảm thấy vinh hạnh?"),c("br"),c("br"),n._v("Bất quá, thấy đối phương hiện tại không muốn nói, đành phải đè lại lòng hiếu kỳ, lựa chọn tin tưởng Dương Huyền, không nói chuyện."),c("br"),c("br"),n._v("“Ngươi muốn đấu giá?”"),c("br"),c("br"),n._v("Lúc này, Nhan Thanh Cổ Thánh đám người, từ rung động thông tin bên trong khôi phục lại."),c("br"),c("br"),n._v("“Không sai, danh ngạch quá nhiều, đối với chúng ta bên này nói, cũng không phải chuyện gì tốt, như vậy trải qua, rất dễ dàng gây nên những người khác ghen tỵ và phẫn hận. Vì lẽ đó, ta tính toán lấy ra bốn cái đấu giá, các ngươi ai chỉ cần trả ra đại giới cao, liền có thể đạt được!”"),c("br"),c("br"),n._v("Trương Huyền cười cười."),c("br"),c("br"),n._v("“Ra giá đi!”"),c("br"),c("br"),n._v("“Danh ngạch, chúng ta Thánh thú nhất tộc, tình thế bắt buộc!”"),c("br"),c("br"),n._v("Nghe được có thể đấu giá, tam đại thế lực Cổ Thánh, tất cả đều nhìn nhau, riêng phần mình gật đầu."),c("br"),c("br"),n._v("Mặc dù sau cùng tranh đoạt ở trong tay bọn họ, nhưng nhiều đi vào một người liền nhiều một phần bảo hiểm."),c("br"),c("br"),n._v("Ngộ nhỡ, Xuân Thu đại điển thật được hắn bọn họ hậu nhân đạt được, vừa ra tới liền có thể xoay người chạy trốn."),c("br"),c("br"),n._v("Đạt tới Cổ Thánh loại thực lực này, muốn đánh giết đối phương rất khó, nhưng chạy trốn, còn là rất dễ dàng, liền có thể làm được."),c("br"),c("br"),n._v("Vì lẽ đó, tiến vào hậu bối càng nhiều, cơ hội càng lớn, điểm ấy không thể nghi ngờ."),c("br"),c("br"),n._v("“Hiện tại ta đấu giá cái thứ nhất danh ngạch, giá trị... 20, 30, a, 50 tích Cổ Thánh chi huyết...”"),c("br"),c("br"),n._v("Trương Huyền xòe bàn tay ra, nói."),c("br"),c("br"),n._v("Đại Thánh chí bảo, đối với hắn mà nói, hiệu quả không lớn, Cổ Thánh chí bảo, đối phương cũng không có mấy món, có thể hay không lấy ra cũng không tốt nói, huống chi, coi như cho hắn, thực lực bây giờ, cũng không có cách nào luyện hóa."),c("br"),c("br"),n._v("Yêu Dị huyền đao, là bởi vì luyện hóa thời điểm, chỉ là nửa bước Cổ Thánh cấp bậc, mới có thể hoàn toàn thần phục."),c("br"),c("br"),n._v("Chân chính đạt tới là loại tu vi này, từng cái kiêu căng khó thuần, năng lực của hắn mạnh hơn, cũng không cách nào thành công."),c("br"),c("br"),n._v("Vì lẽ đó, cùng hắn muốn những này thứ chỉ đẹp mà không có thực, còn không bằng, muốn chút đối với hắn tác dụng lớn nhất Cổ Thánh chi huyết!"),c("br"),c("br"),n._v("Về sau xung kích Cổ Thánh, cũng có rất lớn tác dụng."),c("br"),c("br"),n._v("“Trương Huyền, Cổ Thánh chi huyết chỉ là cái gọi chung, cũng chia làm đẳng cấp, đẳng cấp càng cao, giá trị càng lớn...”"),c("br"),c("br"),n._v("Trương Huyền tiếng nói không lạc, một cái truyền âm bên tai bên trong vang lên."),c("br"),c("br"),n._v("Lão tổ Trương Hoằng Thiên."),c("br"),c("br"),n._v("“Cổ Thánh chi huyết phân đẳng cấp cấp?”"),c("br"),c("br"),n._v("Trương Huyền sững sờ."),c("br"),c("br"),n._v("Hắn cách Cổ Thánh còn kém không biết bao xa, cũng không biết những thứ này."),c("br"),c("br"),n._v("“Không sai, Cổ Thánh cùng Đại Thánh đồng dạng, cũng có đẳng cấp phân chia, đồng dạng chia làm bốn đẳng cấp, cấp bậc càng cao, huyết dịch cũng liền càng trân quý, mỗi cái đẳng cấp ở giữa, chênh lệch không chỉ gấp trăm lần! Nhất định phải xác định đẳng cấp, nếu không... Sẽ rất chịu thiệt!”"),c("br"),c("br"),n._v("Trương Hoằng Thiên nói."),c("br"),c("br"),n._v("“Ừm!” Lên tiếng, Trương Huyền nhịn không được hỏi: “Không biết... Cổ Thánh chia làm, cái nào bốn cái cấp bậc?”"),c("br"),c("br"),n._v("Người đăng: ThấtDạ"),c("br"),c("br"),c("br"),c("br")]),n._v(" "),c("hr"),n._v(" "),c("p",[c("a",{attrs:{href:"./chap-1775"}},[n._v("Chương trước")]),n._v("  |  "),c("a",{attrs:{href:"./chap-1777"}},[n._v("Chương sau")])])])}),[],!1,null,null,null);h.default=g.exports}}]);